import React from 'react'
import { VideoCard } from './VideoCard'

export const Videos = (props) => {
    return (
        <div>
            <pre>{JSON.stringify(props, null, 2)}</pre>
            {
                props.videoData.map(content => (
                    <VideoCard key={content.id} videoData={content}/>
                ))
            }
        </div>
    )
}
